import React from "react";
import forecastCSS from "../styles/forecast.module.css";
const x1 = ["10", "70"];
const y1 = ["10", "70"];
const x2 = ["70", "200"];
const y2 = ["70", "15"];

function ForecastGraph() {
  return (
    <>
      <svg className={forecastCSS.graph}>x1.map((x1) => (return{
        <line x1={x1} y1={y1} x2={x2} y2={y2} stroke="white" />
      }))</svg>
    </>
  );
}

export default ForecastGraph;
